import React from 'react'
import { Icon } from '@iconify/react';
import './SideBar.css'

function SideBar() {
  return (
    <div>
        <div className="logo-school-name">
            <div className="sideBar-logo-div">
                <Icon className='sideBar-logo' fontSize={40} icon="cil:badge" />
                
            </div>
            
        </div>
    </div>
  )
}

export default SideBar
